  templateUrl: './boutton-action.component.html',
  styleUrls: ['./boutton-action.component.scss']
})
export class BouttonActionComponent implements OnInit {

  @Output()
  clickEvent=new EventEmitter();

  constructor(){};

  ngOnInit(): void {}  

  bouttonNouveauClick(){
    this.clickEvent.emit();
  }

}
